import { useContext } from "react";
import { HistoryContext } from "../../context/history-context";
import HistoryTrigger from "./HistoryTrigger/HistoryTrigger";

const HistoryTriggers = () => {
  const { historyDispatch } = useContext(HistoryContext)!;
  const prev = () => {
    historyDispatch({ type: "prev" });
  };

  const next = () => {
    historyDispatch({ type: "next" });
  };

  return (
    <div>
      <HistoryTrigger func={prev}>←</HistoryTrigger>
      <HistoryTrigger func={next}>→</HistoryTrigger>
    </div>
  );
};

export default HistoryTriggers;
